import React from 'react'
import { Alert } from 'react-bootstrap'

const Footer = () => {
    return (
        <Alert variant="success">
            <Alert.Heading>He</Alert.Heading>
            <p>
               Duong Huu Thanh &copy; 2022
            </p>
        </Alert>
    )
}

export default Footer
